import Home from "../components/Home.vue";
import About from "../components/About.vue";
import { createRouter, createWebHistory } from "vue-router";

const routes = [
  {
    path: "/",
    name: "Home",
    component: Home,
  },
  {
    path: "/about",
    name: "About",
    component: About,
  },
];
const history = createWebHistory();

export const router = createRouter({
  history,
  routes,
});
